import axios from 'axios';
import accountStore from '@/composables/accountStore';
import Cookies from 'universal-cookie';

const cookies = new Cookies();

const _sfc_main = {
  props: {
    recept: {
      type: Object,
      required: true
    }
  },
  data() {
    return {
      noviKomentar: '',
      ocjena: 0,
      stars: Array(5).fill('far fa-star'),
      rating: 0
    };
  },
  methods: {
    setRating(rating) {
      this.rating = rating;
      this.stars = this.stars.map((star, index) => {
        if (index < rating) {
          return 'fas fa-star';
        } else if (index < rating) {
          return 'fas fa-star-half-alt';
        } else {
          return 'far fa-star';
        }
      });
    },
    submitRating(rating) {
      const authToken = cookies.get('authToken');
      axios.post('http://127.0.0.1:8000/api/ocjena', {
        recept_id: this.recept.recept_id,
        ocjena: rating
      }, {
        headers: {
          'Authorization': `Bearer ${authToken}`
        }
      })
      .then(() => {
        this.ocjena = rating;
        alert('Uspješno dodana ocjena!');
      })
      .catch(error => {
        console.error(error);
      });
    },
    submitKomentar() {
      const authToken = cookies.get('authToken');
      axios.post('http://127.0.0.1:8000/api/komentari', {
        idrecepta: this.recept.recept_id,
        sadržaj: this.noviKomentar
      }, {
        headers: {
          'Authorization': `Bearer ${authToken}`
        }
      })
      .then(() => {
        this.noviKomentar = '';
        alert('Uspješno dodan komentar!');
      })
      .catch(error => {
        console.error(error);
      });
    }
  }
};

